// src/pages/LoginPage.js
import React from 'react';
import Header from '../components/Header';
import LoginForm from '../components/LoginForm';

const LoginPage = () => (
    <>
        <Header />
        <main>
            <LoginForm />
        </main>
    </>
);

export default LoginPage;
